import React from 'react';
import Cuisine from '../img/Cuisine.png';
import Pokedex from '../img/Pokedex.png';
import Weather from '../img/Weather.png';

const Card = ({ name, src, tech }) => {
  return (
    <div className="Card">
      <a href={src}>
        <img src={`${name}.png` || 'Cuisine.png'} alt="" />
      </a>
      <h3>{name}</h3>
      <p>
        <b>Tech:</b> {tech}
      </p>
    </div>
  );
};
export default Card;

